function Navbar() {
  return (
   <>
        <nav className="w-full sticky  bg-blue-400 mx-auto flex items-center justify-between">        
                    {/* <img className="h-28" src="/images/Logo.png" alt="logo"/> */}
            <ul className="flex items-center px-28 py-5  space-x-11 justify-end font-bold">
                <li>Home</li>
                <li>Testimonials</li>
            </ul>
        </nav>
        </>
  )
}

export default Navbar
